// ==UserScript==
// @name        SD web UI Batch
// @noframes
// @grant       unsafeWindow
// @grant       GM_info
// @grant       GM_addStyle
// @require     https://unpkg.com/jquery@^3.6.0
// @match       *://sdweb.gzpolpo.net/
// @namespace   https://github.com/guansss/userscripts
// @version     0.1
// @author      guansss
// @source      https://github.com/guansss/userscripts
// @supportURL  https://github.com/guansss/userscripts/issues
// ==/UserScript==
;(() => {
  "use strict"

  const ready = new Promise((resolve) => {
    if ("loading" === document.readyState)
      document.addEventListener("DOMContentLoaded", () => resolve)
    else resolve()
  })

  $

  let log

  setLogger(console.log)

  function setLogger(logger) {
    log = logger.bind(console, `[${GM_info.script.name}]`)
  }

  const maskraw_namespaceObject =
    "data:image/png;base64,"

  async function send({ id, image, size, fetchOptions }) {
    const fetch = (url, data) => {
      console.log(url, data)
      return unsafeWindow.fetch(url, data)
    }
    await fetch("http://sdweb.gzpolpo.net/run/predict/", {
      headers: {
        accept: "*/*",
        "accept-language": "zh-CN,zh;q=0.9,en;q=0.8,en-GB;q=0.7,en-US;q=0.6",
        "content-type": "application/json",
      },
      referrer: "http://sdweb.gzpolpo.net/",
      referrerPolicy: "strict-origin-when-cross-origin",
      body: '{"fn_index":211,"data":[],"session_hash":"1arapcamv9f"}',
      method: "POST",
      mode: "cors",
      credentials: "omit",
    })
    await fetch("http://sdweb.gzpolpo.net/run/predict/", {
      headers: {
        accept: "*/*",
        "accept-language": "zh-CN,zh;q=0.9,en;q=0.8,en-GB;q=0.7,en-US;q=0.6",
        "content-type": "application/json",
      },
      referrer: "http://sdweb.gzpolpo.net/",
      referrerPolicy: "strict-origin-when-cross-origin",
      body: '{"fn_index":212,"data":[],"session_hash":"1arapcamv9f"}',
      method: "POST",
      mode: "cors",
      credentials: "omit",
    })
    const options = fetchOptions
    const body = JSON.parse(options.body)
    body.session_hash = "1arapcamv9f"
    body.data[0] = id
    body.data[5] = image
    body.data[30] = size[1]
    body.data[31] = size[0]
    body.data[50].image = image
    body.data[50].mask = maskraw_namespaceObject
    body.data[136] = []
    body.data[137] = JSON.stringify({
      ...JSON.parse(body.data[137]),
      width: size[0],
      height: size[1],
    })
    const data = await fetch("http://sdweb.gzpolpo.net/run/predict/", {
      ...options,
      body: JSON.stringify(body),
    }).then((res) => res.json())
    return data.data[0][0].name
  }

  ready.then(main)

  async function main() {
    if (!unsafeWindow.gradioApp) return

    const originalFetch = unsafeWindow.fetch

    let fetchOptions = unsafeWindow.__lastFetchOptions

    unsafeWindow.fetch = async (url, options) => {
      if (
        url.endsWith("run/predict/") &&
        options?.body &&
        321 === JSON.parse(options.body).fn_index
      ) {
        log("recorded")
        fetchOptions = options
        unsafeWindow.__lastFetchOptions = options
      }

      return originalFetch(url, options)
    }

    const input = $(`<input type="file" multiple style="" accept="image/*" />`).prependTo("body")
    const button = $(`<button>Run</button>`).prependTo("body")
    $(`<button>Stop</button>`)
      .prependTo("body")
      .click(() => (alive = false))
    const status = $(`<div style="color:white"></div>`).prependTo("body")
    const preview = $(`<img style=""/>`).prependTo("body")

    input.on("change", () => {
      status.text(`(${input[0].files.length})`)
    })

    let alive = true

    button.on("click", async () => {
      alive = true

      const maxWidth = 700
      const maxHeight = 700

      const files = input[0].files

      const fileInfo = {}

      for (let i = 0; i < files.length; i++) {
        if (!alive) return

        const file = files[i]

        status.text(`(${i + 1}/${files.length}) ${file.name}`)

        const { image, size } = await new Promise((resolve, reject) => {
          let base64 = ""
          let size = []

          const done = () => {
            if (base64 && size.length) resolve({ image: base64, size })
          }

          const reader = new FileReader()

          reader.onload = (e) => {
            base64 = e.target.result
            done()
          }
          reader.onerror = (e) => {
            reject(e)
          }
          reader.readAsDataURL(file)

          const img = new Image()

          img.onload = () => {
            const scale = Math.min(maxWidth / img.width, maxHeight / img.height)
            size = [Math.floor(img.width * scale), Math.floor(img.height * scale)]
            URL.revokeObjectURL(img.src)
            done()
          }
          img.onerror = (e) => {
            reject(e)
          }
          img.src = URL.createObjectURL(file)
        })

        const id = `task(${Math.random()})`

        send({ id, image, size, fetchOptions }).then((filename) => {
          fileInfo[file.name] = filename
        })

        while (1) {
          if (!alive) return

          const data = await unsafeWindow
            .fetch("http://sdweb.gzpolpo.net/internal/progress", {
              headers: {
                accept: "*/*",
                "accept-language": "zh-CN,zh;q=0.9,en;q=0.8,en-GB;q=0.7,en-US;q=0.6",
                "content-type": "application/json",
              },
              referrer: "http://sdweb.gzpolpo.net/",
              referrerPolicy: "strict-origin-when-cross-origin",
              body: `{"id_task":"${id}","id_live_preview":-1}`,
              method: "POST",
              mode: "cors",
              credentials: "omit",
            })
            .then((res) => res.json())

          if (data.completed) break

          status.text(`(${i + 1}/${files.length}) ${Math.round(100 * data.progress)}% ${file.name}`)

          if (data.live_preview) preview.attr("src", data.live_preview)

          await new Promise((resolve) => setTimeout(resolve, 1e3))
        }
      }

      status.text(`done`)

      log(fileInfo)

      const resultFile = new File([JSON.stringify(fileInfo)], "result.json", {
        type: "application/json",
      })

      const a = document.createElement("a")
      a.href = URL.createObjectURL(resultFile)
      a.download = resultFile.name
      a.click()
    })
  }
})()
